			"text": "방송에서 비정규직 문제는 정규직 방송인과 전문직 패널들에 의해서 다뤄진다. 방송에 초대받지 못한 비정규직 노동자는 직접 자기를 대변하지 못하고 서럽게 울먹이거나 한숨 쉬는 영상으로 대체된다. 그런 식으로 권리의 문제는 연민의 문제로 바뀌어 송출된다.",
